/* eslint-disable no-unused-vars */
import React, { useEffect, useState } from 'react';
import Axios from 'axios'
import { BrowserRouter as Router, Switch, Route, Link, Redirect } from 'react-router-dom'
import MyNotes from './notes/MyNotes'
import AddNote from './notes/AddNote'
import { useHistory, useRouteMatch } from 'react-router';
import Home from './Home';
import Profile from './Profile';

const Dashboard = () => {

    const [user, setUser] = useState("");
    // const [isLoggedIn, setIsLoggedIn] = useState(false)

    const url = "http://localhost:3002";
    const token = localStorage.getItem("token");
    let history = useHistory();

    const getUser = () => {
        Axios.get((url + "/auth"), {
            headers: {
                "token": `${token}`
            }
        }).then((response) => {
            // console.log("response", response)
            setUser(response)
        })
    }


    useEffect(() => {
        getUser();
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [])



    let match = useRouteMatch();

    return (
        <div className="full-web-page d-flex">
            <Router>
                <div className="links-of-adding">
                    <ul>
                        <li>
                            <Link to={`${match.url}/add-note`}>Add note</Link>
                        </li>
                        <li>
                            <Link to={`${match.url}/my-notes`}>My notes</Link>
                        </li>
                    </ul>
                </div>
                <div className="dashboard d-flex flex-grow-1">
                    {/* <button onClick={addNote}>Add note</button>
                    <MyNotes />
                    <button onClick={allNotes}>all notes</button> */}

                    <Switch>
                        <Route exact path={`${match.path}`}>
                            <Home />
                        </Route>
                        <Route exact path={`${match.path}/add-note`}>
                            <AddNote />
                        </Route>
                        <Route exact path={`${match.path}/my-notes`}>
                            <MyNotes />
                        </Route>
                        <Route exact path="**" component={() => "404 NOT FOUND"} />
                    </Switch>
                </div>
                <div className="profile">
                    <Profile />
                </div>
            </Router>
        </div>
    )
}

export default Dashboard
